solution:
To see which points in the rectangle satisfy $x>7y$, we rewrite the inequality as $y<\frac{1}{7}x$.  This inequality is satisfied by the points below the line $y=\frac{1}{7}x$.  Drawing a line with slope $\frac{1}{7}$ and $y$-intercept 0, we obtain the figure below.  We are asked to find the ratio of the area of the shaded triangle to the area of the rectangle.  The vertices of the triangle are $(0,0), (2009,0)$, and $(2009,2009/7)$, so the ratio of areas is  \[
\frac{\frac{1}{2}(2009)\left(\frac{2009}{7}\right)}{2009(2010)}=\frac{2009/14}{2010}=\boxed{\frac{287}{4020}}.
\]

[asy]
unitsize(7mm);
defaultpen(linewidth(.7pt)+fontsize(8pt));
dotfactor=4;

fill((0,0)--(4,0)--(4,.5714)--cycle,gray);

draw((-2,0)--(5,0),Arrows(4));
draw((0,-2)--(0,5),Arrows(4));

draw((0,0)--(4,0)--(4,4.2)--(0,4.2)--cycle);

dot((4,4.2));
label("$(2009,2010)$",(4,4.2),NE);

draw((0,0)--(4.8,.686),linetype("4 4"),Arrows(4));
label("$y=x/7$",(4.8,.686),NE); [/asy]

Let $P$ and $Q$ be the the intersection points of the two parabolas.  Then by definition of the parabola, the distance from $P$ to their common focus $F$ is equal to the distance from $P$ to the $x$-axis.  Also, the distance between $P$ to $F$ is equal to $P$ to the $y$-axis.  This means $P$ is equidistant to both the $x$-axis and $y$-axis, so $P$ must lie on the line $y = -x.$

[asy]
unitsize(0.15 cm);

pair F, P, Q;

real parab (real x) {
  return(-(x^2 - 6*x + 793)/56);
}

real upperparab(real x) {
  return(sqrt(3)*sqrt(2*x - 3) - 28);
}

real lowerparab(real x) {
  return(-sqrt(3)*sqrt(2*x - 3) - 28);
}

F = (3,-28);
P = (18.0385,-18.0385);
Q = (43.9615,-43.9615);

draw((-10,0)--(50,0));
draw((0,-50)--(0,10));
draw(graph(parab,-10,47),red);
draw(graph(upperparab,3/2,50),blue);
draw(graph(lowerparab,3/2,50),blue);
draw(F--P--(P.x,0));
draw(P--(0,P.y));
draw(F--Q--(Q.x,0));
draw(Q--(0,Q.y));
draw((-10,10)--(50,-50),dashed);

label("$F$", F, NW, UnFill);
label("$P$", P, NE, UnFill);
label("$Q$", Q, NE, UnFill);

dot(F);
[/asy]

By the same argument, $Q$ also lies on the line $y = -x.$  Therefore, the slope of $\overline{PQ}$ is $\boxed{-1}.$

problem:
The smaller square in the figure below has a perimeter of $4$ cm, and the larger square has an area of $16$ $\text{cm}^2$.  What is the distance from point $A$ to point $B$? Express your answer as a decimal to the nearest tenth.

[asy]
draw((0,0)--(12,0));
draw((2,0)--(2,10));
draw((0,0)--(0,2));
draw((0,2)--(2,2));
draw((0,2)--(12,10));
draw((12,0)--(12,10));
draw((2,10)--(12,10));
label("B",(0,2),W);
label("A",(12,10),E);
[/asy]

solution:
Since the smaller square has a perimeter of 4 cm and its sides are equal in length, each side measures $4/4=1$ cm. Since the larger square has area 16 square cm, each side measures $\sqrt{16}=4$ cm. To find the length of $AB$, we draw a right triangle with $AB$ as the hypotenuse and the two sides parallel to the sides of the squares, as shown below: [asy]
draw((0,0)--(12,0));
draw((2,0)--(2,10));
draw((0,0)--(0,2));
draw((0,2)--(2,2));
draw((0,2)--(12,10));
draw((12,0)--(12,10));
draw((2,10)--(12,10));
draw((0,2)--(12,2)--(12,10),dashed);
label("B",(0,2),W);
label("A",(12,10),E);[/asy] The horizontal side has length $1+4=5$ (the length of the smaller square and the length of the larger square added together) and the vertical side has length $4-1=3$ (the length of the larger square minus the length of the smaller square). Using the Pythagorean Theorem, the length of $AB$ is $\sqrt{5^2+3^2}=\sqrt{34}\approx\boxed{5.8}$ cm.

We have that $D$ is the midpoint of $BC$, and that $CD = BC/2 = 20 \sqrt{3}/2 = 10 \sqrt{3}$.

[asy]
unitsize(3 cm);

pair A, B, C, D, E;

A = dir(133);
B = dir(193);
C = dir(-13);
D = (B + C)/2;
E = extension(A, C, D, D + rotate(90)*(B - C));

draw(A--B--C--cycle);
draw(D--E);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, S);
label("$E$", E, NE);
[/asy]

Also, triangle $CED$ is a $30^\circ$-$60^\circ$-$90^\circ$ triangle, so $DE = CD/\sqrt{3} = 10 \sqrt{3}/\sqrt{3} = \boxed{10}$.

problem:
In $\Delta ABC$, $\overline{DE} \parallel \overline{AB}, CD = 4$ cm, $DA = 10$ cm, and $CE = 6$ cm. What is the number of centimeters in the length of $\overline{CB}$?

[asy]pair A,B,C,D,E;
A = (-2,-4); B = (4,-4); C = (0,0); D = A/3; E = B/3;
draw(E--D--C--B--A--D);
label("A",A,W); label("B",B,dir(0)); label("C",C,N); label("D",D,W);

label("E",E,dir(0));
[/asy]

solution:
Since $DE \parallel AB,$ we know that $\angle CDE = \angle CAB$ and $\angle CED = \angle CBA.$ Therefore, by AA similarity, we have $\triangle ABC \sim DEC.$ Then, we find: \begin{align*}
\frac{CB}{CE} &= \frac{CA}{CD} = \frac{CD + DA}{CD}\\
\frac{CB}{6\text{ cm}} &= \frac{4\text{ cm} + 10\text{ cm}}{4\text{ cm}} = \frac{7}{2}\\
CB &= 6\text{cm} \cdot \frac{7}{2} = \boxed{21}\text{ cm}.
\end{align*}

[asy]
unitsize(0.8inch);
for (int i=0 ; i<=11 ;++i)
{
draw((rotate(i*30)*(0.8,0)) -- (rotate(i*30)*(1,0)));
label(format("%d",i+1),(rotate(60 - i*30)*(0.68,0)));
}
draw(Circle((0,0),1),linewidth(1.1));
draw((0,0.7)--(0,0)--(rotate(-60)*(0.5,0)),linewidth(1.2));
[/asy]

There are 12 hours on a clock, so each hour mark is $360^\circ/12 = 30^\circ$ from its neighbors.  At 5:00, the minute hand points at the 12, while the hour hand points at hour 5.  So, the angle between the hands is $5\cdot 30^\circ = \boxed{150^\circ}$.

Let $\mathbf{a}$ denote $\overrightarrow{A},$ etc.

Since $\overline{BE}$ is the angle bisector, by the Angle Bisector Theorem,
\[\frac{BD}{CD} = \frac{AB}{AC} = \frac{7}{5},\]so $\mathbf{d} = \frac{5}{12} \mathbf{b} + \frac{7}{12} \mathbf{c}.$

Similarly,
\[\frac{AE}{CE} = \frac{AB}{BC} = \frac{7}{3},\]so $\mathbf{e} = \frac{3}{10} \mathbf{a} + \frac{7}{10} \mathbf{c}.$

[asy]
unitsize(1 cm);

pair A, B, C, D, E, P;

B = (0,0);
C = (3,0);
A = intersectionpoint(arc(B,7,0,180),arc(C,5,0,180));
D = extension(A,incenter(A,B,C),B,C);
E = extension(B,incenter(A,B,C),A,C);
P = incenter(A,B,C);

draw(A--B--C--cycle);
draw(A--D);
draw(B--E);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, S);
label("$E$", E, SE);
label("$P$", P, NW);
[/asy]

Isolating $\mathbf{c}$ in each equation, we obtain
\[\mathbf{c} = \frac{12 \mathbf{d} - 5 \mathbf{b}}{7} = \frac{10 \mathbf{e} - 3 \mathbf{a}}{7}.\]Then $12 \mathbf{d} - 5 \mathbf{b} = 10 \mathbf{e} - 3 \mathbf{a},$ so $3 \mathbf{a} + 12 \mathbf{d} = 5 \mathbf{b} + 10 \mathbf{e},$ or
\[\frac{3}{15} \mathbf{a} + \frac{12}{15} \mathbf{d} = \frac{5}{15} \mathbf{b} + \frac{10}{15} \mathbf{e}.\]Since the coefficients on both sides of the equation add up to 1, the vector on the left side lies on line $AD,$ and the vector on the right side lies on line $BE.$  Therefore, this common vector is $\mathbf{p}.$  Furthermore, $\frac{BP}{PE} = \frac{10}{5} = \boxed{2}.$

problem:
In the diagram, four circles of radius 1 with centers $P$, $Q$, $R$, and $S$ are tangent to one another and to the sides of $\triangle ABC$, as shown. [asy]
size(200);
pair A, B, C, P, Q, R, S;
R=(0,0);
Q=(-2,0);
S=(2,0);
P=(1,1.732);
B=(-5.73,-1);
C=(3.732,-1);
A=(1.366,3.098);
draw(A--B--C--A);
draw(circle(P, 1));
draw(circle(Q, 1));
draw(circle(R, 1));
draw(circle(S, 1));
label("A", A, N);
label("B", B, SW);
label("C", C, SE);
dot(P);
dot(Q);
dot(R);
dot(S);
label("P", P, N);
label("Q", Q, SW);
label("R", R, SW);
label("S", S, SE);
[/asy]

Find the perimeter of triangle $ABC$.

solution:
Join $PQ$, $PR$, $PS$, $RQ$, and $RS$. Since the circles with centers $Q$, $R$ and $S$ are all tangent to $BC$, then $QR$ and $RS$ are each parallel to $BC$ (as the centers $Q$, $R$ and $S$ are each 1 unit above $BC$). This tells us that $QS$ passes through $R$.

Similarly, since $P$ and $S$ are each one unit from $AC$, then $PS$ is parallel to $AC$. Also, since $P$ and $Q$ are each one unit from $AB$, then $PQ$ is parallel to $AB$. Therefore, the sides of $\triangle PQS$ are parallel to the corresponding sides of $\triangle ABC$.


When the centers of tangent circles are joined, the line segments formed pass through the associated point of tangency, and so have lengths equal to the sum of the radii of those circles. Therefore, $QR=RS=PR=PS=1+1=2$.

[asy]
size(200);
pair P, Q, R, S;
Q=(0,0);
R=(2,0);
S=(4,0);
P=(3,1.732);
label("Q", Q, SW);
label("R", R, dir(270));
label("S", S, SE);
label("P", P, N);
draw(circle(Q,1), dashed);
draw(circle(P,1), dashed);
draw(circle(R,1), dashed);
draw(circle(S,1), dashed);
draw(P--Q--S--P--R);
[/asy]

Since $PR=PS=RS$, we know $\triangle PRS$ is equilateral, so $\angle PSR=\angle PRS=60^\circ$. Since $\angle PRS=60^\circ$ and $QRS$ is a straight line, we have $\angle QRP=180^\circ-60^\circ=120^\circ$.

Since $QR=RP$, we know $\triangle QRP$ is isosceles, so $$\angle PQR = \frac{1}{2}(180^\circ-120^\circ)= 30^\circ.$$Since $\angle PQS=30^\circ$ and $\angle PSQ=60^\circ$, we have $$\angle QPS = 180^\circ - 30^\circ - 60^\circ = 90^\circ,$$so $\triangle PQS$ is a $30^\circ$-$60^\circ$-$90^\circ$ triangle.

The angles of $\triangle ABC$ are equal to the corresponding angles of $\triangle PQS$, so $\triangle ABC$ is a $30^\circ$-$60^\circ$-$90^\circ$ triangle. This means that if we can determine one of the side lengths of $\triangle ABC$, we can then determine the lengths of the other two sides using the side ratios in a $30^\circ$-$60^\circ$-$90^\circ$ triangle.

Consider side $AC$. Since the circle with center $P$ is tangent to sides $AB$ and $AC$, the line through $A$ and $P$ bisects $\angle BAC$.  Thus, $\angle PAC=45^\circ$. Similarly, the line through $C$ and $S$ bisects $\angle ACB$.  Thus, $\angle SCA=30^\circ$. We extract trapezoid $APSC$ from the diagram, obtaining

[asy]
size(200);
pair A, P, S, C, Z, X;
C=(0,0);
Z=(1.732,0);
X=(3.732,0);
A=(4.732,0);
S=(1.732,1);
P=(3.732,1);
draw(A--X--Z--C--S--P--A);
draw(S--Z);
draw(P--X);
label("A", A, SE);
label("Z", Z, dir(270));
label("X", X, dir(270));
label("C", C, SW);
label("S", S, NW);
label("P", P, dir(45));
label("1", (S+Z)/2, E);
label("1", (X+P)/2, E);
label("2", (S+P)/2, N);
draw((1.732,.15)--(1.882,.15)--(1.882,0));
draw((3.732,.15)--(3.582,.15)--(3.582,0));
label("$30^\circ$", (.35,.15), E);
label("$45^\circ$", (4.5,.15), W);
[/asy]

Drop perpendiculars from $P$ and $S$ to $X$ and $Z$, respectively, on side $AC$. Since $PS$ is parallel to $AC$, and $PX$ and $SZ$ are perpendicular to $AC$, we know that $PXZS$ is a rectangle, so $XZ=PS=2$.

Since $\triangle AXP$ is right-angled at $X$, has $PX=1$ (the radius of the circle), and $\angle PAX=45^\circ$, we have $AX=PX=1$. Since $\triangle CZS$ is right-angled at $Z$, has $SZ=1$ (the radius of the circle), and $\angle SCZ=30^\circ$, we have $CZ=\sqrt{3}SZ=\sqrt{3}$ (since $\triangle SZC$ is also a $30^\circ$-$60^\circ$-$90^\circ$ triangle). Thus, $AC=1+2+\sqrt{3}=3+\sqrt{3}$.

Since $\triangle ABC$ is a $30^\circ$-$60^\circ$-$90^\circ$ triangle, with $\angle ACB=60^\circ$ and $\angle CAB=90^\circ$, we have $BC=2AC=6+2\sqrt{3}$, and $$AB=\sqrt{3}AC=\sqrt{3}(3+\sqrt{3})=3\sqrt{3}+3.$$Therefore, the side lengths of $\triangle ABC$ are $AC=3+\sqrt{3}$, $AB=3\sqrt{3}+3$, and $BC=6+2\sqrt{3}$. Thus, the perimeter is $$3+\sqrt{3}+3\sqrt{3}+3+6+2\sqrt{3}=\boxed{12+6\sqrt{3}}.$$

The vertices of the trapezoid are $(5,5)$, $(10,10)$, $(0,10)$, and $(0,5)$.  Its bases are $5$ and $10$ units long, and its height is $5$ units.  Averaging the bases and multiplying by the height, we find an area of $\left(\frac{5+10}{2}\right)(5)=\boxed{37.5}$ square units.

[asy]
unitsize(2mm);
defaultpen(linewidth(.7pt)+fontsize(8pt));
dotfactor=4;

fill((5,5)--(10,10)--(0,10)--(0,5)--cycle,gray);

draw((-12,-12)--(14,14),Arrows(4));
draw((-14,10)--(14,10),Arrows(4));
draw((-14,5)--(14,5),Arrows(4));

draw((-15,0)--(15,0),Arrows(4));
draw((0,-15)--(0,15),Arrows(4));

label("$y=x$",(14,14),NE);
label("$y=10$",(14,10),E);
label("$y=5$",(14,5),E);[/asy]

We can start by drawing a diagram of the routes that each of them took: [asy]
size(150);
draw((0,0)--(0,9)--(12,9)--cycle,linewidth(1));
label("9",(0,4.5),W);
label("12",(6,9),N);
label("15",(6,4.5),SE);
[/asy] The two routes form a 9-12-15 right triangle.  Kelly drove for $9+12=21$ miles at a rate of 42 miles per hour, so she drove for $21/42=.5$ hours which equals 30 minutes.  Brenda drove for 15 miles at an average rate of 45 miles per hour, so she drove for $15/45\cdot 60=20$ minutes.  Thus, Brenda arrived $30-20=\boxed{10}$ minutes earlier than Kelly.

Since all edges of pyramid $SPQR$ have length $18$ or $41$, each triangular face must be isosceles: either $18$-$18$-$41$ or $18$-$41$-$41$. But the first of these two sets of side lengths violates the triangle inequality, since $18+18<41$. Therefore, every face of $SPQR$ must have sides of lengths $18,$ $41,$ and $41$.

To find the area of each face, we draw an $18$-$41$-$41$ triangle with altitude $h$: [asy]
size(4cm);
pair a=(0,40); pair b=(-9,0); pair c=(9,0); pair o=(0,0);
dot(a); dot(b); dot(c); draw(a--b--c--a); draw(a--o,dashed); draw(rightanglemark(a,o,c,60));
label("$h$",(a+2*o)/3,SE);
label("$41$",(a+c)/2,E);
label("$9$",(o+c)/2,N);
label("$41$",(a+b)/2,W);
label("$9$",(o+b)/2,N);
[/asy] Since the triangle is isosceles, we know the altitude bisects the base (as marked above). By the Pythagorean theorem, we have $9^2+h^2=41^2$ and thus $h=40$. So, the triangle has area $\frac 12\cdot 18\cdot 40 = 360$.

The surface area of pyramid $SPQR$ is made up of four such triangles, so it amounts to $4\cdot 360 = \boxed{1440}$.

${\bf Remark.}$  One might wonder whether a pyramid with the properties enumerated in the problem actually exists. The answer is yes! To form such a pyramid, imagine attaching two $18$-$41$-$41$ triangles (like that in the diagram) along their short edges, so that the triangles are free to rotate around that hinge: [asy]
import three;
triple a=(9,0,0); triple b=-a; triple c=(0,sqrt(1519),-9); triple d=(0,sqrt(1519),9);
dot(a); dot(b); dot(c); dot(d);
draw(surface(a--b--c--cycle),orange,nolight);
draw(b--c--a);
draw(surface(a--b--d--cycle),yellow,nolight);
draw(b--d--a--b);
draw(c--d,dashed);
[/asy] Now you can adjust the distance between the two "free" vertices (the dotted line in the diagram above) so that it is $18$. Adding that edge to the diagram and filling in, we have a pyramid with the desired properties.

