problem:
Square $ABCD$ has side length 2. A semicircle with diameter $\overline{AB}$ is constructed inside the square, and the tangent to the semicircle from $C$ intersects side $\overline{AD}$ at $E$. What is the length of $\overline{CE}$?

[asy]
pair A,B,C,D,I;
I=(0,2.5);
A=(0,0);
B=(10,0);
C=(10,10);
D=(0,10);
draw((5,5)..A--B..cycle,linewidth(0.7));
draw(C--I,linewidth(0.7));
draw(A--B--C--D--cycle,linewidth(0.7));
label("$A$",A,SW);
label("$B$",B,SE);
label("$C$",C,NE);
label("$D$",D,NW);
label("$E$",I,W);
[/asy]

solution:
Let $F$ be the point at which $\overline{CE}$ is tangent to the semicircle, and let $G$ be the midpoint of $\overline{AB}$.  Because $\overline{CF}$ and $\overline{CB}$ are both tangents to the semicircle, $CF = CB = 2$.  Similarly, $EA =
EF$.  Let $x = AE$.  The Pythagorean Theorem applied to $\triangle
CDE$ gives \[
(2-x)^{2}+ 2^{2}= (2+x)^{2}.
\]It follows that $x= 1/2$ and $CE = 2 + x= \boxed{\frac{5}{2}}$.

[asy]
pair A,B,C,D,I;
I=(0,2.5);
A=(0,0);
B=(10,0);
C=(10,10);
D=(0,10);
draw((5,5)..A--B..cycle,linewidth(0.7));
draw(C--I,linewidth(0.7));
draw(A--B--C--D--cycle,linewidth(0.7));
label("$A$",A,SW);
label("$B$",B,SE);
label("$C$",C,NE);
label("$D$",D,NW);
label("$E$",I,W);
label("$F$",(2,4),NW);
label("$G$",(5,0),S);
draw((5,0)--C,dashed);
draw((5,0)--(2,4),dashed);
draw((5,0)--I,dashed);
[/asy]

problem:
Each of the small circles in the figure has radius one. The innermost circle is tangent to the six circles that surround it, and each of those circles is tangent to the large circle and to its small-circle neighbors. Find the area of the shaded region.

[asy]
fill(Circle((0,0),3),gray(0.7));
fill(Circle((0,0),1),white);
fill(Circle((1.73,1),1),white);
