solution:
Name the vertices of the hexagon so that hexagon $ABCDEF$ has $AB=1$, $BC=7$, $CD=2$, and $DE=4$.  The hexagon is equiangular, so each interior angle measures $180(6-2)/6=120$ degrees.  Extend sides $AB$, $CD$, and $EF$ and call their intersection points $G$, $H$, and $J$ as shown.  The exterior angles of the hexagon each measure $180-120=60$ degrees, so triangles $JDE$, $CBH$, $FGA$, and $JHG$ are all equilateral.  It follows that $JD=DE=4$ units and $CH=CB=7$ units.  Therefore the side length $JH$ of triangle $JGH$ is $4+2+7=13$ units.  Turning to side $HG$, we find that $AF=AG=13-(7+1)=5$ units.  Finally, we solve $JG=JE+EF+FG$ for $EF$ to get $EF=13-(4+5)=4$ units.  The sum of the missing sides is $5+4=\boxed{9}$ units.

[asy]
size(6cm);
defaultpen(linewidth(.7pt)+fontsize(8pt));
dotfactor=4;

pair A=(8,0), B=(7,0), C=7*dir(60), D=9*dir(60), Ep=(13,0)+9*dir(120), F=(13,0)+5*dir(120), G=(13,0), H=(0,0), J=13*dir(60);

pair[] dots = {A, B, C, D, Ep, F};

dot(dots);

draw(A--B--C--D--Ep--F--cycle);

draw(B--H--C,dashed);
draw(D--J--Ep,dashed);
draw(F--G--A,dashed);

label("$A$",A,S);
label("$B$",B,S);
label("$C$",C,NW);
label("$D$",D,NW);
label("$E$",Ep,NE);
label("$F$",F,NE);
label("$G$",G,SE);
label("$H$",H,SW);
label("$J$",J,N);

label("$1$",(A+B)/2,N);
label("$7$",(B+C)/2,NE);
label("$2$",(C+D)/2,SE);
label("$4$",(D+Ep)/2,S);
[/asy]

problem:
The parabola $y = ax^2 + bx + c$ crosses the $x$-axis at $(p,0)$ and $(q,0),$ both to the right of the origin.  A circle also passes through these two points.  Let $t$ be the length of the tangent from the origin to the circle.  Express $t^2$ in terms of one or more of the coefficients $a,$ $b,$ and $c.$

[asy]
unitsize(3 cm);

pair A, O, T;

real func (real x) {
  return ((x - 1)*(x - 2));
}

A = (1.5,-0.4);
O = (0,0);
T = intersectionpoint(Circle(A,abs(A - (1,0))),arc(A/2,abs(A)/2,0,90));

draw(graph(func,0.5,2.5));
draw((-0.5,0)--(2.5,0));
draw((0,-1)--(0,1));
draw(Circle(A,abs(A - (1,0))));
draw(O--T);

label("$t$", T/3, N);

dot(T);
[/asy]

solution:
Let $A$ be the center of the circle, let $r$ be the radius of the circle, let $O$ be the origin, and let $T$ be the point of tangency.  Then $\angle OTA = 90^\circ,$ so by the Pythagorean Theorem,
\[t^2 = AO^2 - AT^2 = AO^2 - r^2.\][asy]
unitsize(3 cm);

pair A, O, T;

real func (real x) {
  return ((x - 1)*(x - 2));
}

A = (1.5,-0.4);
O = (0,0);
T = intersectionpoint(Circle(A,abs(A - (1,0))),arc(A/2,abs(A)/2,0,90));

draw(graph(func,0.5,2.5));
draw((-0.5,0)--(2.5,0));
draw((0,-1)--(0,1));
draw(Circle(A,abs(A - (1,0))));
draw(A--T--O--cycle);
draw(rightanglemark(O,T,A,3));

label("$O$", O, NW);
label("$t$", T/3, N);

dot("$A$", A, S);
dot("$T$", T, N);
[/asy]

The center of the circle is equidistant to both $(p,0)$ and $(q,0)$ (since they are both points on the circle), so the $x$-coordinate of $A$ is $\frac{p + q}{2}.$  Let
\[A = \left( \frac{p + q}{2}, s \right).\]Then using the distance from $A$ to $(q,0),$
\[r^2 = \left( \frac{p - q}{2} \right)^2 + s^2.\]Also,
\[AO^2 = \left( \frac{p + q}{2} \right)^2 + s^2.\]Therefore,
\begin{align*}
t^2 &= AO^2 - r^2 \\
&= \left( \frac{p + q}{2} \right)^2 + s^2 - \left( \frac{p - q}{2} \right)^2 - s^2 \\
&= pq.
\end{align*}By Vieta's formulas, $pq = \frac{c}{a},$ so
\[t^2 = pq = \boxed{\frac{c}{a}}.\]Alternatively, by power of a point, if $P = (p,0)$ and $Q = (q,0),$ then
\[t^2 = OT^2 = OP \cdot OQ = pq.\]

Since the angles in a triangle add to $180^\circ,$ then the missing angle in the triangle is $180^\circ-50^\circ-60^\circ=70^\circ.$ We then have: [asy]
