Since $\angle ABO = 60^\circ$, and this angle is external to triangle $BCO$, $\angle BOC = \angle ABO - \angle BCO = 60^\circ - 30^\circ = 30^\circ$.  Hence, triangle $BCO$ is isosceles, and $BC = BO = \boxed{5}$.

problem:
