solution:
The area of triangle $ABC$ is given by
\[[ABC] = \frac{1}{2} AC \cdot BC \cdot \sin C.\][asy]
unitsize (1 cm);

pair A, B, C, D;

A = (0,0);
B = (5,0);
C = (1,2);
D = extension(C, incenter(A,B,C), A, B);

draw(A--B--C--cycle);
draw(C--D);

label("$A$", A, SW);
label("$B$", B, SE);
label("$C$", C, N);
label("$D$", D, S);
label("$6$", (C + D)/2, NE);
[/asy]

We can also write
\begin{align*}
[ABC] &= [ACD] + [BCD] \\
&= \frac{1}{2} AC \cdot CD \sin \frac{C}{2} + \frac{1}{2} BC \cdot CD \sin \frac{C}{2} \\
&= 3AC \sin \frac{C}{2} + 3BC \sin \frac{C}{2} \\
&= 3 (AC + BC) \sin \frac{C}{2}.
\end{align*}Thus,
\[\frac{1}{2} AC \cdot BC \cdot \sin C = 3(AC + BC) \sin \frac{C}{2}.\]Then
\[AC \cdot BC \sin \frac{C}{2} \cos \frac{C}{2} = 3(AC + BC) \sin \frac{C}{2},\]so
\[\frac{AC \cdot BC}{3} = 3 (AC + BC).\]Hence,
\[\frac{1}{AC} + \frac{1}{BC} = \frac{AC + BC}{AC \cdot BC} = \boxed{\frac{1}{9}}.\]

Let $\mathbf{p}$ be the projection of $\mathbf{c}$ onto the plane containing $\mathbf{a}$ and $\mathbf{b}.$

[asy]
import three;

size(140);
currentprojection = perspective(6,3,2);

real t = 60, k = Cos(t);

triple A, B, C, O, P, Q;

A = (Cos(t/2),Sin(t/2),0);
B = (Cos(t/2),-Sin(t/2),0);
C = (k/Cos(t/2),0,sqrt(1 - k^2/Cos(t/2)^2));
O = (0,0,0);
P = (k/Cos(t/2),0,0);
Q = k/(k + 1)*A + k/(k + 1)*B;

draw(O--A,Arrow3(6));
draw(O--B,Arrow3(6));
draw(O--C,Arrow3(6));
draw(O--P,Arrow3(6));
draw(C--P,dashed);

label("$\mathbf{a}$", A, S, fontsize(10));
label("$\mathbf{b}$", B, W, fontsize(10));
label("$\mathbf{c}$", C, NW, fontsize(10));
label("$\mathbf{p}$", P, SW, fontsize(10));
[/asy]

Then
\[\mathbf{p} = s \mathbf{a} + t \mathbf{b}\]for some scalars $s$ and $t.$  Let $\mathbf{n}$ be the normal vector to the plane containing $\mathbf{a}$ and $\mathbf{b},$ so
\[\mathbf{c} = \mathbf{p} + u \mathbf{n} = s \mathbf{a} + t \mathbf{b} + u \mathbf{n}\]for some scalar $u.$

Taking the dot product with $\mathbf{a},$ we get
\[\mathbf{a} \cdot \mathbf{c} = s \mathbf{a} \cdot \mathbf{a} + t \mathbf{a} \cdot \mathbf{b} + u \mathbf{a} \cdot \mathbf{n}.\]Note that $\mathbf{a} \cdot \mathbf{a} = \|\mathbf{a}\|^2 = 4$ and $\mathbf{a} \cdot \mathbf{b} = \mathbf{a} \cdot \mathbf{c} = 2 \cdot 2 \cdot \frac{5}{8} = \frac{5}{2}.$  Also, $\mathbf{a} \cdot \mathbf{n} = 0,$ so
\[\frac{5}{2} = 4s + \frac{5t}{2}.\]Similarly, taking the dot product with $\mathbf{b},$ we get
\[\mathbf{b} \cdot \mathbf{c} = s \mathbf{a} \cdot \mathbf{b} + t \mathbf{b} \cdot \mathbf{b} + u \mathbf{b} \cdot \mathbf{n}.\]This reduces to $\frac{5}{2} = \frac{5s}{2} + 4t.$

Solving the equations $\frac{5}{2} = 4s + \frac{5t}{2}$ and $\frac{5}{2} = \frac{5s}{2} + 4t,$ we get $s = t = \frac{5}{13}.$  Hence,
\[\mathbf{p} = \frac{5}{13} (\mathbf{a} + \mathbf{b}).\]Then
\begin{align*}
\|\mathbf{p}\|^2 &= \frac{25}{169} (\mathbf{a} \cdot \mathbf{a} + 2 \mathbf{a} \cdot \mathbf{b} + \mathbf{b} \cdot \mathbf{b}) \\
&= \frac{25}{169} \left( 4 + 2 \cdot \frac{5}{2} + 4 \right) = \frac{25}{13}.
\end{align*}By Pythagoras, the height of the parallelepiped is then given by
\[\sqrt{4 - \|\mathbf{p}\|^2} = \sqrt{4 - \frac{25}{13}} = \sqrt{\frac{27}{13}}.\]The base of the parallelepiped has area $2 \cdot 2 \cdot \sin \left( \arccos \frac{5}{8} \right) = 4 \sqrt{1 - \left( \frac{5}{8} \right)^2} = 4 \sqrt{\frac{39}{64}},$ so the volume of the parallelepiped is
\[\sqrt{\frac{27}{13}} \cdot 4 \sqrt{\frac{39}{64}} = \boxed{\frac{9}{2}}.\]

Arrange the five numbers 1, 2, 3, 4, 5 in a circle, in some order.  We can place the 5 at the top; let the other numbers be $a,$ $b,$ $c,$ $d.$  Then the sum we are interested in is the sum of the product of adjacent pairs.

[asy]
unitsize(1 cm);

label("$5$", dir(90), fontsize(18));
label("$a$", dir(90 - 360/5), fontsize(18));
label("$b$", dir(90 - 2*360/5), fontsize(18));
label("$c$", dir(90 - 3*360/5), fontsize(18));
label("$d$", dir(90 - 4*360/5), fontsize(18));
[/asy]

Assume that the numbers have been arranged so that the sum we are interested in has been maximized.  The sum for this arrangement is $5a + ab + bc + cd + 5d.$  This means that if we were to change the arrangement, the sum must either stay the same or decrease.

Suppose we swap 5 and $a$:

[asy]
unitsize(1 cm);

label("$a$", dir(90), fontsize(18));
label("$5$", dir(90 - 360/5), fontsize(18));
label("$b$", dir(90 - 2*360/5), fontsize(18));
label("$c$", dir(90 - 3*360/5), fontsize(18));
label("$d$", dir(90 - 4*360/5), fontsize(18));
[/asy]

The sum is now $5a + 5b + bc + cd + ad.$  Hence,
\[5a + 5b + bc + cd + ad \le 5a + ab + bc + cd + 5d.\]This reduces to $ab - ad + 5d - 5b \ge 0,$ which factors as $(5 - a)(d - b) \ge 0.$  We know $5 - a \ge 0,$ so $d - b \ge 0.$  And since $b$ and $d$ are distinct, $d > b.$

Now, suppose we swap 5 and $d$:

[asy]
unitsize(1 cm);

label("$d$", dir(90), fontsize(18));
label("$a$", dir(90 - 360/5), fontsize(18));
label("$b$", dir(90 - 2*360/5), fontsize(18));
label("$c$", dir(90 - 3*360/5), fontsize(18));
label("$5$", dir(90 - 4*360/5), fontsize(18));
[/asy]

The sum is now $ad + ab + bc + 5c + 5d.$  Hence,
\[ad + ab + bc + 5c + 5d \le 5a + ab + bc + cd + 5d.\]This reduces to $cd - ad + 5a - 5c \ge 0,$ which factors as $(5 - d)(a - c) \ge 0.$  We know $5 - d \ge 0,$ so $a - c \ge 0.$  And since $a$ and $c$ are distinct, $a > c.$

Finally, by reflecting the diagram along the vertical axis, we can assume that $b > c.$  This leaves three cases to check:
\[
\begin{array}{c|c|c|c|c}
a & b & c & d & 5a + ab + bc + cd + 5d \\ \hline
2 & 3 & 1 & 4 & 43 \\
3 & 2 & 1 & 4 & 47 \\
4 & 2 & 1 & 3 & 48
\end{array}
\]Hence, the largest possible sum is 48.  Furthermore, there are ten permutations that work: The five cyclic permutations of $(5,4,2,1,3),$ and the five cyclic permutations of its reverse, namely $(5,3,1,2,4).$  Thus, $M + N = 48 + 10 = \boxed{58}.$

First observe that if one vertex of a triangle is moved directly toward another vertex so as to shrink one side length of the triangle by a factor of $k$, then the area of the triangle is also shrinked by $k$.  To see this, think of the side that is shrinking as the base in the equation $\text{area}=\frac{1}{2}(\text{base})(\text{height})$.

Use brackets to denote area; for example, $[ABC]$ refers to the area of triangle $ABC$.  We have \[ [DBE]=\frac{1}{3}[DBC]=\frac{1}{3}\left(\frac{2}{3}[ABC]\right)=\frac{2}{9}[ABC]. \] Similarly, $[ADF]=[CFE]=\frac{2}{9}[ABC]$.  Therefore,  \begin{align*}
[DEF]&=[ABC]-[ADF]-[CFE]-[DBE] \\
&= \left(1-\frac{2}{9}-\frac{2}{9}-\frac{2}{9}\right)[ABC] \\
&=\frac{1}{3}[ABC],
\end{align*} so $[DEF]/[ABC]=\boxed{\frac{1}{3}}$.
[asy]
import graph;
size(150);
defaultpen(linewidth(0.7));
dotfactor=4;

xaxis(Ticks(" ",1.0,begin=false,end=false,NoZero,Size=3),Arrows(4));
yaxis(Ticks(" ",1.0,begin=false,end=false,NoZero,Size=3),Arrows(4));

pair A=(0,0), B=(9,6), C=(6,12), D=2*A/3+B/3, Ep=2*B/3+C/3, F=2*C/3+A/3;
pair[] dots={A,B,C,D,Ep,F};
Label[] alphabet={"$A$", "$B$", "$C$", shift(5,0)*"$D$", "$E$", "$F$"};
draw(A--B--C--cycle);
draw(Ep--D--F--cycle);

int i;

for(i=0;i<=5;++i)

{

dot(alphabet[i],dots[i],unit(dots[i]-(A+B+C)/3));

}[/asy]

