solution:
The graph of the original parabola ($A$) and its final image ($A'$) after rotation and translation is shown below:

[asy]
Label f;

f.p=fontsize(4);

xaxis(-3,4,Ticks(f, 2.0));

yaxis(-3,7,Ticks(f, 2.0));
real f(real x)

{

return (x-2)^2+3;

}

draw("$A$", graph(f,0,4), linewidth(1));
real g(real x)

{

return -(x+1)^2+1;

}

draw("$A'$", graph(g,-3,1), linewidth(1));
[/asy]

Rotating the original parabola 180 degrees changes its equation to $y=-(x-2)^2+3$. Shifting this last parabola to the left changes its equation to $y=-(x+1)^2+3$. Shifting it down changes its equation to $y=-(x+1)^2+1$. So the equation of $A'$ is $y=-(x+1)^2+1$. To find the zeros of this parabola, we set $y=0$ to get $0=-(x+1)^2+1$. Expanding the right hand side gives $0=-x^2-2x$. Dividing through by $-1$ and factoring out an $x$ from the right hand side, we get $0=x(x+2)$, so either $x=0$ or $x+2=0$. Thus, $a=0$ and $b=-2$, so $a+b=\boxed{-2}$.

More generally, suppose we have a line $l$ that is reflect across line $l_1$ to obtain line $l'.$

[asy]
unitsize(3 cm);

draw(-0.2*dir(35)--dir(35));
draw(-0.2*dir(60)--dir(60));
draw(-0.2*dir(10)--dir(10));
draw((-0.2,0)--(1,0));
draw((0,-0.2)--(0,1));

label("$l$", dir(60), NE);
label("$l_1$", dir(35), NE);
label("$l'$", dir(10), E);
[/asy]

Also, suppose line $l$ makes angle $\theta$ with the $x$-axis, and line $l_1$ makes angle $\alpha$ with the $x$-axis.  Then line $l'$ makes angle $2 \alpha - \theta$ with the $x$-axis.  (This should make sense, because line $l_1$ is "half-way" between lines $l$ and $l',$ so the angle of line $l_1$ is the average of the angles of line $l$ and $l'$.)

So, if $l$ makes an angle of $\theta$ with the $x$-axis, then its reflection $l'$ across line $l_1$ makes an angle of
\[2 \cdot \frac{\pi}{70} - \theta = \frac{\pi}{35} - \theta\]with the $x$-axis.

Then the reflection of $l'$ across line $l_2$ makes an angle of
\[2 \cdot \frac{\pi}{54} - \left( \frac{\pi}{35} - \theta \right) = \theta + \frac{8 \pi}{945}\]with the $x$-axis.

Therefore, the line $R^{(n)}(l)$ makes an angle of
\[\theta + \frac{8 \pi}{945} \cdot n\]with the $x$-axis.  For this line to coincide with the original line $l,$
\[\frac{8 \pi}{945} \cdot n\]must be an integer multiple of $2 \pi.$  The smallest such positive integer for which this happens is $n = \boxed{945}.$

