It follows that a side length of the square is equal to the diameter of the circle, or $2\sqrt{20}$. The area of the square is thus $\left(2\sqrt{20}\right)^2 = \boxed{80}$ square units.

Notice that the information that the sides were parallel to the x-axis is irrelevant.

Since the vertex angle of the cross-section triangle measures $60^\circ$, the cross-section triangle is equilateral.  Also, the cross-section of the sphere inscribed in the cone is a circle tangent to each of the triangle's sides.  Call the vertices of the equilateral triangle $A$, $B$, and $C$, and let $O$ be the center of the circle and $D$ and $E$ the midpoints of segments $AB$ and $BC$, respectively.  To find the radius of the circle, divide the 30-60-90 triangle $CDB$ into three smaller congruent 30-60-90 triangles as shown.  Since the area of each of these triangles is smaller by a factor of $3$ than the area of triangle $CDB$, each corresponding side must be smaller by a factor of $\sqrt{3}$.  Thus $OE=DB/\sqrt{3}=6$ inches.  Therefore, the volume of the sphere is $V=\frac{4}{3}\pi(\text{radius})^3=\frac{4}{3}\pi(\text{6 inches})^3=\boxed{288\pi}$ cubic inches.

[asy]

size(2.5inch);

pair A = (0,0);
pair B = (2,0);
pair C = (1,sqrt(3));
pair O = (1,sqrt(3)/3);

draw(O--B);
draw(O--C);
draw(O--(B+C)/2);
draw(O--(A+B)/2);

draw(A--B--C--cycle);
draw(circle(O,sqrt(3)/3));

label("$A$",A,SW);
label("$B$",B,SE);
label("$C$",C,N);
label("$D$",(A+B)/2,S);
label("$E$",(B+C)/2,NE);
label("$O$",O,W);
label("$12\sqrt{3}$",(1,-0.2),S);

[/asy]

The circumference of the whole circle is $2 \pi \cdot 6 = 12 \pi$, so the circumference of the base of the cone is $12 \pi/3 = 4 \pi$.  Hence, the radius of the base of the cone is $4 \pi/(2 \pi) = 2$.

[asy]
unitsize(2 cm);

fill((0,0)--arc((0,0),1,-60,60)--cycle,gray(0.7));
draw(Circle((0,0),1));
draw((0,0)--dir(60));
draw((0,0)--dir(180));
draw((0,0)--dir(300));
label("$6$", dir(60)/2, NW);
[/asy]

The slant height of the cone is 6 (the radius of the original circle), so by Pythagoras, the height of the cone is $\sqrt{6^2 - 2^2} = \sqrt{32} = \boxed{4 \sqrt{2}}$.

[asy]
unitsize(0.8 cm);

draw((-2,0)--(2,0)--(0,4*sqrt(2))--cycle);
draw((0,0)--(0,4*sqrt(2)));

label("$2$", (1,0), S);
label("$6$", (1,2*sqrt(2)), NE);
label("$4 \sqrt{2}$", (0,0.7*2*sqrt(2)), W);
[/asy]

