solution:
By the Law of Cosines on triangle $ABC,$
\[BC = \sqrt{3^2 + 6^2 - 2 \cdot 3 \cdot 6 \cdot \frac{1}{8}} = \frac{9}{\sqrt{2}}.\][asy]
