label("$r$",(s/2,s),unit((-2,1)));
draw(rightanglemark((0,0),(s,0),(s,2s),3.0));

picture pic1;

draw(pic1,Circle((0,0),1));
draw(pic1,(1/sqrt(2),1/sqrt(2))--(-1/sqrt(2),1/sqrt(2))--(-1/sqrt(2),-1/sqrt(2))--(1/sqrt(2),-1/sqrt(2))--cycle);
draw(pic1,(0,0)--(1/sqrt(2),1/sqrt(2)),linetype("2 3"));
label(pic1,"$r$",(1/sqrt(2),1/sqrt(2))/2,unit((-1,1)));
dot(pic1,(0,0));
draw(pic1,(0,0)--(1/sqrt(2),0));
draw(pic1,rightanglemark((0,0),(1/sqrt(2),0),(1/sqrt(2),1/sqrt(2)),3.0));

add(shift((2.5,0))*pic1);[/asy]

Let $n$ be the number of soldiers. According to the problem statement, it follows that \begin{align*}
n &\equiv 0 \pmod{4} \\
n &\equiv 2 \pmod{3} \\
n &\equiv 5 \pmod{11}
\end{align*}By the Chinese Remainder Theorem, there is an unique residue that $n$ can leave, modulo $33$; since $5 \equiv 2 \pmod{3}$, it follows that $n \equiv 5 \pmod{33}$. Also, we know that $n$ is divisible by $4$, so by the Chinese Remainder Theorem again, it follows that $n \equiv 104 \pmod{132}$. Writing out the first few positive values of $n$, we obtain that $n = 104, 236, 368$, and so forth. The closest value of $n$ is $\boxed{236}$.

Begin by distributing in the innermost parentheses: \begin{align*}
\left(2x+\frac{3}{2} (4x-6)\right)-&4\left( -(2-x)+\frac{x}{2}\right)\\
&=(2x+6x-9)-4\left(-2+x+\frac{x}{2}\right)\\
&=(8x-9)-4\left (-2+\frac{3x}{2}\right)
\end{align*} Now, distribute again, and combine like terms: \begin{align*}
(8x-9)-4\left (-2+\frac{3x}{2}\right)&=8x-9+8-6x\\
&=\boxed{2x-1}
\end{align*}

Let $\mathbf{a} = \overrightarrow{OA},$ $\mathbf{b} = \overrightarrow{OB},$ and $\mathbf{c} = \overrightarrow{OC}.$  Then
\[\overrightarrow{AB} = \overrightarrow{OB} - \overrightarrow{OA} = \mathbf{b} - \mathbf{a}.\]Similarly, $\overrightarrow{AC} = \mathbf{c} - \mathbf{a}$ and $\overrightarrow{BC} = \mathbf{c} - \mathbf{b}.$  We then want to compute
\[\overrightarrow{OA} \cdot \overrightarrow{BC} = \mathbf{a} \cdot (\mathbf{c} - \mathbf{b}) = \mathbf{a} \cdot \mathbf{c} - \mathbf{a} \cdot \mathbf{b}.\][asy]
unitsize(2 cm);

pair A, B, C, O;

A = dir(100);
B = dir(200);
C = dir(340);
O = (0,0);

draw(Circle(O,1));
draw(A--B--C--cycle);
draw(O--A,Arrow(6));
draw(O--B,Arrow(6));
draw(O--C,Arrow(6));

label("$A$", A, A);
label("$B$", B, B);
label("$C$", C, C);
label("$O$", O, NE);
label("$\mathbf{a}$", A/2, SW);
label("$\mathbf{b}$", B/2, SE);
label("$\mathbf{c}$", C/2, SW);
[/asy]

Since $AC = 5,$ $AC^2 = 25.$  But
\begin{align*}
AC^2 &= \|\mathbf{c} - \mathbf{a}\|^2 \\
&= (\mathbf{c} - \mathbf{a}) \cdot (\mathbf{c} - \mathbf{a}) \\
&= \|\mathbf{c}\|^2 - 2 \mathbf{a} \cdot \mathbf{c} + \|\mathbf{a}\|^2 \\
&= 2R^2 - 2 \mathbf{a} \cdot \mathbf{c},
\end{align*}where $R$ is the circumradius.  Hence,
\[\mathbf{a} \cdot \mathbf{c} = R^2 - \frac{AC^2}{2}.\]Similarly, we can prove that
\[\mathbf{a} \cdot \mathbf{b} = R^2 - \frac{AB^2}{2}.\]Therefore,
\[\mathbf{a} \cdot \mathbf{c} - \mathbf{a} \cdot \mathbf{b} = \left( R^2 - \frac{AC^2}{2} \right) - \left( R^2 - \frac{AB^2}{2} \right) = \frac{AB^2 - AC^2}{2} = \frac{3^2 - 5^2}{2} = \boxed{-8}.\]

