We will calculate the area of the hexagon in two different ways.  Let the interior point in the figure be called $P$, and let $s$ be the side length of the hexagon. The areas of the triangles $APB$, $BPC$, $CPD$, $DPE$, $EPF$, and $FPA$ are $\frac{1}{2}(s)(4)$, $\frac{1}{2}(s)(6)$, $\frac{1}{2}(s)(9)$, $\frac{1}{2}(s)(10)$, $\frac{1}{2}(s)(8)$, and $\frac{1}{2}(s)(5)$, respectively.  Also, the area of a regular hexagon with side length $s$ is $3s^2\sqrt{3}/2$.  Setting the sum of the triangles' areas equal to $3s^2\sqrt{3}/2$ gives \begin{align*}
\frac{1}{2}s(4 + 6 + 9 + 10 + 8 + 5)&=\frac{3s^2\sqrt{3}}{2} \implies \\
21s&=\frac{3s^2\sqrt{3}}{2} \implies \\
14s &= s^2\sqrt{3} \implies \\
s=0 \quad \text{or} \quad s &= \frac{14}{\sqrt{3}} \\
&= \frac{14}{\sqrt{3}}\cdot\frac{\sqrt{3}}{\sqrt{3}}=\boxed{\frac{14\sqrt{3}}{3}} \text{ cm}.
\end{align*}[asy]
unitsize(0.3 cm);

pair A, B, C, D, E, F, P, U, V, W, X, Y, Z;

A = 14*sqrt(3)/3*dir(60);
B = 14*sqrt(3)/3*dir(120);
C = 14*sqrt(3)/3*dir(180);
D = 14*sqrt(3)/3*dir(240);
E = 14*sqrt(3)/3*dir(300);
F = 14*sqrt(3)/3*dir(360);
P = extension(A + (0,-4), B + (0,-4), A + 5*dir(210), F + 5*dir(210));

U = (P + reflect(A,B)*(P))/2;
V = (P + reflect(B,C)*(P))/2;
W = (P + reflect(C,D)*(P))/2;
X = (P + reflect(D,E)*(P))/2;
Y = (P + reflect(E,F)*(P))/2;
Z = (P + reflect(F,A)*(P))/2;

draw(A--B--C--D--E--F--cycle);
draw(U--X,dotted);
draw(V--Y,dotted);
draw(W--Z,dotted);
draw(A--P);
draw(B--P);
draw(C--P);
draw(D--P);
draw(E--P);
draw(F--P);

label("$A$", A, dir(60));
label("$B$", B, dir(120));
label("$C$", C, dir(180));
label("$D$", D, dir(240));
label("$E$", E, dir(300));
label("$F$", F, dir(360));
label("$P$", P, SW, UnFill);
label("$4$", (P + U)/2, dir(180));
label("$6$", (P + V)/2, SW);
label("$9$", (P + W)/2, SE);
label("$10$", (P + X)/2, dir(180));
label("$8$", (P + Y)/2, SW);
label("$5$", (P + Z)/2, SE);
[/asy]

Let the number of quarters in the first, second, third, and fourth piles be $a$, $b$, $c$, and $d$, respectively. We have the equations \begin{align*} \tag{1}
a+b+c+d&=27\\ \tag{2}
a&=b-5\\ \tag{3}
b&=c+4\\ \tag{4}
d&=3b
\end{align*} We want to find the value of $d$. We will express each of $a$, $b$, and $c$ in terms of $d$ and then substitute these equations into Equation (1) to find the value of $d$. From Equation (4), we have $b=d/3$. From Equation (3), we have $c=b-4$. Since $b=d/3$, we can rewrite Equation (3) as $c=d/3-4$. We can substitute $b=d/3$ into Equation (2) to get $a=d/3-5$. Substituting $b=d/3$, $c=d/3-4$, and $a=d/3-5$ into Equation (1) to eliminate $a$, $b$, and $c$, we get $(d/3-5)+d/3+(d/3-4)+d=27$, so $d=18$. Thus, there are $\boxed{18}$ quarters in the fourth pile.

