We draw a regular hexagon $ABCDEF$ as shown below.  The desired distance can be measured by diagonal $AC$: [asy]

size(120);
pair A,B,C,D,E,F;
A = dir(0); B = dir(60); C = dir(120); D = dir(180); E = dir(240); F = dir(300);

draw(E--C);

label("$6$",(A+B)/2,NE);
label("$A$",C,NW);label("$B$",D,W);label("$C$",E,SW);label("$D$",F,SE);label("$E$",A,ENE);label("$F$",B,NE);
draw(A--B--C--D--E--F--A);
[/asy] To compute the length of $AC$, we let $H$ be the foot of the perpendicular from $B$ to $AC$: [asy]

size(120);
pair A,B,C,D,E,F;
A = dir(0); B = dir(60); C = dir(120); D = dir(180); E = dir(240); F = dir(300);

draw(E--C);

label("$6$",(A+B)/2,NE);
label("$A$",C,NW);label("$B$",D,W);label("$C$",E,SW);label("$D$",F,SE);label("$E$",A,ENE);label("$F$",B,NE);
draw(A--B--C--D--E--F--A); pair H=(E+C)/2; draw(D--H); label("$H$",H,ENE);
[/asy] Since the hexagon is regular, $\angle ABC = 120^\circ$ and $\angle ABH = \angle CBH = 120^\circ / 2 = 60^\circ$.  Thus, $\triangle ABH$ and $\triangle CBH$ are congruent $30^\circ - 60^\circ - 90^\circ$ triangles.  These triangles are each half an equilateral triangle, so their short leg is half as long as their hypotenuse.

Since $AB=BC=6$, we have $BH = AB/2 = 3$ and $AH = CH = \sqrt{6^2-3^2} = \sqrt{27} = 3\sqrt{3}$.  (Notice that this value is $\sqrt{3}$ times the length of $BH$, the short leg.  In general, the ratio of the sides in a $30^\circ - 60^\circ - 90^\circ$ triangle is $1:\sqrt{3}:2$, which can be shown by the Pythagorean Theorem.)  Then, $AC = 2\cdot 3\sqrt{3} = 6\sqrt{3}$.  Thus, any pair of parallel sides in this regular hexagon are $\boxed{6\sqrt{3}}$ units apart.

First, we shall sketch! [asy]
pair A, B, C, D;
A = (0,90);
B = (0,0);
C = (56,0);
D = (56*90/(90+106),0);
draw(A--B--C--cycle);
draw(A--D);
label("$A$", A, NW);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NE);
label("$90$", (A + B)/2, W);
label("$x$", (B + C)/2, S);
label("$2x-6$", (A + C)/2, NE);
draw(rightanglemark(A,B,C,90));
[/asy] The first step is to find $x.$ To do this, we simply plug into the Pythagorean Theorem: \begin{align*}
AB^2 + BC^2 &= AC^2 \\
90^2 + x^2 &= (2x - 6)^2 \\
8100 + x^2 &= 4x^2 - 24x + 36 \\
0 &= 3x^2 - 24x - 8064 \\
0 &= x^2 - 8x - 2688 \\
0 &= (x - 56)(x + 48).
\end{align*} The factorization is a little tricky, especially with a large constant term like $-2688,$ but it helps noticing that $2688$ is close to $52^2 = 2704,$ and the $-8x$ term indicates that our factors that multiply to $-2688$ have to be close. That helps narrow our search greatly.

In any case, clearly $x = -48$ is extraneous, so we have that $x = 56.$ Therefore, we have $AC = 106$ and $BC = 56.$ (Did you know that $28:45:53$ is a Pythagorean triple?)

Now, to find the area of $\triangle ADC$ is straightforward. First, clearly the height to base $DC$ is $90,$ so we only really need to find $DC.$ Here we use the Angle Bisector Theorem: \begin{align*}
\frac{BD}{DC} &= \frac{AB}{AC}\\
\frac{BD}{DC} &= \frac{90}{106} = \frac{45}{53}\\
1 + \frac{BD}{DC} &= 1 + \frac{45}{53}\\
\frac{BD + DC}{DC} = \frac{BC}{DC} &= \frac{98}{53}\\
\frac{56}{DC} &= \frac{98}{53}\\
DC &= \frac{53}{98} \cdot 56 = \frac{212}{7}.
\end{align*}

Our area is $\frac{1}{2} \cdot 90 \cdot \frac{212}{7} = 1362\frac{6}{7} \approx \boxed{1363}.$

Let $F_1 = (3,7)$ and $F_2 = (d,7).$  Then the center of the ellipse is $C = \left( \frac{d + 3}{2}, 7 \right),$ and the point where the ellipse is tangent to the $x$-axis is $T = \left( \frac{d + 3}{2}, 0 \right).$

[asy]
unitsize(0.3 cm);

path ell = shift((29/3,7))*yscale(7)*xscale(29/3)*Circle((0,0),1);
pair[] F;
pair C, T;

F[1] = (3,7);
F[2] = (49/3,7);
T = (29/3,0);
C = (29/3,7);

draw(ell);
draw((0,-2)--(0,14));
draw((-2,0)--(58/3,0));
draw((0,7)--F[2]--T--F[1]);
draw(C--T);

dot("$C$", C, N);
dot("$F_1$", F[1], N);
dot("$F_2$", F[2], N);
dot("$T$", T, S);
[/asy]

Then for any point $P$ on the ellipse, $PF_1 + PF_2 = 2 \cdot \frac{d + 3}{2} = d + 3.$  In particular, this holds for $P = T,$ so
\[2 \sqrt{\left( \frac{d - 3}{2} \right)^2 + 7^2} = d + 3.\]Then
\[\sqrt{(d - 3)^2 + 196} = d + 3.\]Squaring both sides, we get $(d - 3)^2 + 196 = d^2 + 6d + 9.$  This simplifies to $12d = 196,$ so $d = \frac{196}{12} = \boxed{\frac{49}{3}}.$

