problem:
$\Delta ABC$ is isosceles with $AC = BC$. If $m\angle C = 40^{\circ}$, what is the number of degrees in $m\angle CBD$? [asy] pair A,B,C,D,E;
C = dir(65); B = C + dir(-65); D = (1.5,0); E = (2,0);
draw(B--C--A--E); dot(D);
label("$A$",A,S); label("$B$",B,S); label("$D$",D,S); label("$C$",C,N);
[/asy]

solution:
Let $x$ be the number of degrees in $\angle ABC$. Since $\triangle ABC$ is isosceles with $AC=BC$, we have $\angle BAC=\angle ABC$.

So, the three interior angles of $\triangle ABC$ measure $x^\circ$, $x^\circ$, and $40^\circ$. The sum of the angles in a triangle is $180^\circ$, so we have $$x+x+40 = 180,$$which we can solve to obtain $x=70$. Finally, $\angle CBD$ is supplementary to angle $\angle ABC$, so \begin{align*}
m\angle CBD &= 180^\circ - m\angle ABC \\
&= 180^\circ - 70^\circ \\
&= \boxed{110}^\circ.
\end{align*}

problem:
The lateral surface area of the frustum of a solid right cone is the product of one-half the slant height ($L$) and the sum of the circumferences of the two circular faces. What is the number of square centimeters in the total surface area of the frustum shown here? Express your answer in terms of $\pi$.

[asy]
draw( scale(1,.2)*arc(origin,10,180,360) ) ;
draw( scale(1,.2)*arc(origin,10,15,165) , dashed ) ; //yes, there is a gap
draw( (-10,0)--(10,0) , dotted ) ;
label("20cm",(0,0),S);
draw((0,0)--(0,8));
label("8cm",(0,4),E);
draw( shift(0,8)*scale(1,.2)*circle(origin,4) ) ;
draw( (-4,8)--(4,8) , dotted ) ;
label("8cm",(0,8),N);
draw((-10,0)--(-4,8));
draw((10,0)--(4,8));
label("$L$",(5,4),NE);
[/asy]

solution:
The circumferences of the bases are $2 \pi \cdot 4 = 8 \pi$ and $2 \pi \cdot 10 = 20 \pi$.  To find the slant height, we drop perpendiculars.

[asy]
unitsize(0.3 cm);

draw((-10,0)--(10,0)--(4,8)--(-4,8)--cycle);
draw((4,0)--(4,8));
draw((-4,0)--(-4,8));

label("$8$", (0,0), S);
label("$6$", (7,0), S);
label("$6$", (-7,0), S);
label("$8$", (0,8), N);
label("$8$", (4,4), W);
label("$L$", (7,4), NE);
[/asy]

We have created a right triangle with legs 6 and 8, so the hypotenuse is $L = 10$.

Hence, the total surface area of the frustum, including the two bases, is \[\pi \cdot 4^2 + \pi \cdot 10^2 + \frac{1}{2} \cdot 10 \cdot (8 \pi + 20 \pi) = \boxed{256 \pi}.\]

