problem:
Given that

\begin{align*}
\frac{1}{x}+\frac{1}{y}&=3,\\
xy+x+y&=4,
\end{align*}

compute $x^2y+xy^2$.

solution:
Let the side length of the equilateral triangle be $d$. $15/3=5$ Joules of energy are stored when two charges are at distance $d$, so $2\cdot5=10$ Joules are stored when they are at distance $d/2$, because energy is inversely proportional to distance. This means that in the second configuration, the pair $(A,C)$ and $(B,C)$ store 10 Joules each, and since $(A,B)$ still stores 5 Joules, the final configuration stores a total of $10+10+5=25$ Joules, which is $25-15=\boxed{10}$ Joules more than the initial configuration. [asy]
dot((0,0)); dot((2,0)); dot((1,1.732));
label("$A$",(0,0),S); label("$B$",(2,0),S); label("$C$",(1,1.732),N);
draw((3,.866)--(5,.866),EndArrow);
dot((6,0)); dot((8,0)); dot((7,0));
label("$A$",(6,0),S); label("$B$",(8,0),S); label("$C$",(7,0),S);
[/asy]

Remember that $\frac{1}{3} = 0.\overline{3}.$ We can multiply both the numerator and denominator by $10$ to help simplify the fraction: \begin{align*}
\frac{0.\overline{3}}{0.8\overline{3}} \cdot \frac{10}{10} &= \frac{0.\overline{3}\cdot 10}{0.8\overline{3} \cdot 10} =\frac{3.\overline{3}}{8.\overline{3}} \\
&=\dfrac{3+\frac{1}{3}}{8+\frac{1}{3}} =\dfrac{\frac{10}{3}}{\frac{25}{3}} \\
&=\frac{\cancelto{2}{10}}{\cancel{3}} \cdot \frac{\cancel{3}}{\cancelto{5}{25}\hspace{3mm}} =\boxed{\frac{2}{5}}.
\end{align*}

