Note that $A$ is the focus of the parabola $y^2 = 4x,$ and the directrix is $x = -1.$  Then by definition of the parabola, the distance from $P$ to $A$ is equal to the distance from $P$ to the line $x = -1.$  Let $Q$ be the point on $x = -1$ closest to $P,$ and let $R$ be the point on $x = -1$ closest to $B.$

[asy]
unitsize(0.6 cm);

real upperparab (real x) {
  return (sqrt(4*x));
}

real lowerparab (real x) {
  return (-sqrt(4*x));
}

pair A, B, P, Q, R;

A = (1,0);
B = (5,4);
P = (1.5,upperparab(1.5));
Q = (-1,upperparab(1.5));
R = (-1,4);

draw(A--P--B);
draw(graph(upperparab,0,6));
draw(graph(lowerparab,0,6));
draw((-1,-5)--(-1,5),dashed);
draw(P--Q);
draw(B--R);
draw(B--Q);

dot("$A$", A, S);
dot("$B$", B, E);
dot("$P$", P, SE);
dot("$Q$", Q, W);
dot("$R$", R, W);
[/asy]

Then by the triangle inequality,
\[AP + BP = QP + BP \ge BQ.\]By the Pythagorean Theorem, $BQ = \sqrt{BR^2 + QR^2} \ge BR = 6.$

Equality occurs when $P$ coincides with the intersection of line segment $\overline{BR}$ with the parabola, so the minimum value of $AP + BP$ is $\boxed{6}.$

problem:
Piravena must make a trip from $A$ to $B,$ then from $B$ to $C,$ then from $C$ to $A.$ Each of these three parts of the trip is made entirely by bus or entirely by airplane. The cities form a right-angled triangle as shown, with $C$ a distance of $3000\text{ km}$ from $A$ and with $B$ a distance of $3250\text{ km}$ from $A.$ To take a bus, it costs Piravena $\$0.15$ per kilometer. To take an airplane, it costs her a $\$100$ booking fee, plus $\$0.10$ per kilometer. [asy]
