problem:
A rectangular field is enclosed in an athletic track, as shown below.  The track consists of two edges of the field, and two semicircles.  The length of the track is 400 meters.  What is the largest possible area of the field, in square meters?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

solution:
Let the width of the rectangle be $w,$ and let the radius of each semicircle be $r.$

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));

label("$w$", (1.5,0), S);
label("$r$", (3,1/2), E);
dot((3,1));
[/asy]

Then the length of the track is $2w + 2 \pi r = 400,$ so $w + \pi r = 200.$  By AM-GM,
\[200 = w + \pi r \ge 2 \sqrt{w \pi r},\]so $\sqrt{w \pi r} \le 100.$  Then $w \pi r \le 10000,$ so
\[wr \le \frac{10000}{\pi}.\]Then the area of the field, $2wr,$ must satisfy
\[2wr \le \frac{20000}{\pi}.\]Equality occurs when $w = 100$ and $r = \frac{100}{\pi},$ so the largest possible area is $\boxed{\frac{20000}{\pi}}.$

problem:
A circular cylindrical post with a circumference of 4 feet has a string wrapped around it, spiraling from the bottom of the post to the top of the post. The string evenly loops around the post exactly four full times, starting at the bottom edge and finishing at the top edge. The height of the post is 12 feet. What is the length, in feet, of the string?

[asy]
size(150);
draw((0,0)--(0,20)..(1,19.5)..(2,20)--(2,0)..(1,-.5)..(0,0),linewidth(1));
draw((0,20)..(1,20.5)..(2,20),linewidth(1));
draw((1,19.5)--(0,18.5),linewidth(1));
draw((2,.5)--(1,-.5),linewidth(1));
draw((2,16)--(0,14),linewidth(1));
draw((2,11)--(0,9),linewidth(1));

draw((2,6)--(0,4),linewidth(1));

[/asy]

solution:
Each time the string spirals around the post, it travels 3 feet up and 4 feet around the post.  If we were to unroll this path, it would look like: [asy]
size(150);
draw((0,0)--(0,3)--(4,3)--(4,0)--cycle, linewidth(.7));
draw((0,0)--(4,3),linewidth(.7));
label("3",(0,1.5),W);
label("4",(2,3),N);
[/asy] Clearly, a 3-4-5 right triangle has been formed.  For each time around the post, the string has length 5.  So, the total length of the string will be $4\cdot 5=\boxed{20}$ feet.

