draw((i,-0.2)--(i,0.2));
}
draw((2.83,1.17)..B--A--D..cycle,linewidth(0.7));
draw(A--B--C--D--cycle,linewidth(0.7));
draw((2,2)..C--D..cycle,linewidth(0.7));
