[/asy]



We also could have solved this problem with a little trigonometry:

Let $\angle MAD = \alpha$. Then \begin{align*}
PQ &= (PA)\sin(\angle PAQ) \\
&= 4\sin(2\alpha) \\
&= 8 \sin\alpha\cos\alpha\\
&= 8\displaystyle\left(\frac{2}{\sqrt{20}}\right)\left(\frac{4}{\sqrt{20}}\displaystyle\right)\\
&=\boxed{\frac{16}{5}}.
\end{align*}

problem:
Find the units digit of the following:  \begin{align*}
& (972 - 268)(973 - 267)(974 - 266) \\
&\qquad+ (968 - 272)(967 - 273)(966 - 274) - (999 - 222)^3
\end{align*}

solution:
We rearrange the sum to make it easier to collect like terms: \begin{align*}
&(x^3+4x^2-7x+11)+(-4x^4-x^3+x^2+7x+3)\\
&\qquad=-4x^4+(1-1)x^3+(1+4)x^2+(-7+7)x+(11+3)\\
&\qquad=\boxed{-4x^4+5x^2+14}.
\end{align*}

By the sum-to-product formula,
\begin{align*}
\frac{\sin 13^\circ + \sin 47^\circ + \sin 73^\circ + \sin 107^\circ}{\cos 17^\circ} &= \frac{2 \sin 30^\circ \cos 17^\circ + 2 \sin 90^\circ \cos 17^\circ}{\cos 17^\circ} \\
&= 2 \sin 30^\circ + 2 \sin 90^\circ \\
&= \boxed{3}.
\end{align*}

By Pythagoras, the lengths $x,$ $\sqrt{16 - x^2},$ and 4 are the sides of a right triangle.  Similarly, $y,$ $\sqrt{25 -  y^2},$ and 5 are the sides of a right triangle, and $z,$ $\sqrt{36 - z^2},$ and 6 are the sides of a right triangle.  Stack these right triangles, as shown below.  Then $AE = x + y + z = 9$ and
\[DE = \sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2}.\][asy]
unitsize(0.4 cm);

pair A, B, C, D, E, P, Q, R, trans;

A = (0,0);
B = 4*dir(40);
C = B + 5*dir(60);
D = C + 6*dir(30);
E = (D.x,0);
P = (B.x,0);
Q = (C.x,B.y);
R = (D.x,C.y);
trans = (14,0);

draw(A--B--P--cycle);
draw(B--C--Q--cycle);
draw(C--D--R--cycle);
draw(P--E--R,dashed);

label("$x$", (A + P)/2, S, red);
label("$\sqrt{16 - x^2}$", (B + P)/2, dir(0), red);
label("$4$", (A + B)/2, NW, red);
label("$y$", (B + Q)/2, S, red);
label("$\sqrt{25 - y^2}$", (C + Q)/2, dir(0), red);
label("$5$", (B + C)/2, NW, red);
label("$z$", (C + R)/2, S, red);
label("$\sqrt{36 - z^2}$", (D + R)/2, dir(0), red);
label("$6$", (C + D)/2, NW, red);
label("$A$", A, SW);
label("$B$", B, NW);
label("$C$", C, NW);
label("$D$", D, NE);
label("$E$", E, SE);

draw(shift(trans)*(A--B--C--D--E--cycle));
draw(shift(trans)*(A--D),dashed);

label("$A$", A + trans, SW);
label("$B$", B + trans, SE);
label("$C$", C + trans, NW);
label("$D$", D + trans, NE);
label("$E$", E + trans, SE);
label("$9$", (A + E)/2 + trans, S, red);
label("$\sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2}$", (D + E)/2 + trans, dir(0), red);
[/asy]

By the Triangle Inequality,
\[AD \le AB + BC + CD = 4 + 5 + 6 = 15.\]By Pythagoras on right triangle $ADE,$
\[9^2 + (\sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2})^2 = AD^2 \le 15^2,\]so $(\sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2})^2 \le 15^2 - 9^2 = 144.$  Hence,
\[\sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2} \le 12.\]Equality occurs when $x = \frac{12}{5},$ $y = 3,$ and $z = \frac{18}{5}.$  (Note that this corresponds to the case where $A,$ $B,$ $C,$ and $D$ are collinear.)  Thus, the maximum value we seek is $\boxed{12}.$

Simplify according to the order of operations. \begin{align*}
3!(2^3+\sqrt{9})\div 2 &= 6(8+3)\div 2 \\
&=6(11)\div 2 \\
&=66\div 2\\
&=\boxed{33}.
\end{align*}

