problem:
Two parallel chords in a circle have lengths 10 and 14, and the distance between them is 6. The chord parallel to these chords and midway between them is of length $\sqrt{a}$. Find the value of $a$. [asy]
import olympiad; import geometry; size(100); defaultpen(linewidth(0.8));
draw(unitcircle);
draw(Label("14",align=N),dir(30)--dir(150));
draw(Label("10",align=N),dir(-40)--dir(-140));
draw(Label("$\sqrt{a}$",align=N),dir(-5)--dir(-175));
distance(rotate(90)*"6",(1,Sin(30)),(1,Sin(-40)),-9,Arrows(size=1));

[/asy]

solution:
Let $x$ be the distance from the center $O$ of the circle to the chord of length $10$, and let $y$ be the distance from $O$ to the chord of length $14$. Let $r$ be the radius.  Then, \begin{align*}
x^2+25&=r^2,\\
y^2+49&=r^2,\\
{\rm so}\qquad x^2+25&=y^2+49.\\
{\rm Therefore,}\qquad x^2-y^2&=(x-y)(x+y)=24.
\end{align*}[asy]
import olympiad; import geometry; size(100); defaultpen(linewidth(0.8));
draw(unitcircle);
pair midpoint14 = (dir(40)+dir(140))/2;
pair midpoint10 = (dir(-30)+dir(-150))/2;
draw(Label("7",align=N),dir(40)--midpoint14);
draw(Label("7",align=N),midpoint14--dir(140));
draw(Label("5",align=S),dir(-30)--midpoint10);
draw(Label("5",align=S),midpoint10--dir(-150));
draw(Label("$y$",align=E),origin--midpoint14);
draw(Label("$x$",align=E),origin--midpoint10);
draw(Label("$r$",align=E),dir(40)--origin);
draw(Label("$r$",align=E),dir(-30)--origin);
label("$O$",origin,W);
[/asy]

If the chords are on the same side of the center of the circle, $x-y=6$. If they are on opposite sides, $x+y=6$. But $x-y=6$ implies that $x+y=4$, which is impossible. Hence $x+y=6$ and $x-y=4$. Solve these equations simultaneously to get $x=5$ and $y=1$. Thus, $r^2=50$, and the chord parallel to the given chords and midway between them is two units from the center. If the chord is of length $2d$, then $d^2+4=50$, $d^2=46$, and $a=(2d)^2=\boxed{184}$.

