In rectangle $ABCD$, points $F$ and $G$ lie on $\overline{AB}$ so that $AF = FG = GB$ and $E$ is the midpoint of $\overline{DC}$. Also, $\overline{AC}$ intersects $\overline{EF}$ at $H$ and $\overline{EG}$ at $J$. The area of rectangle $ABCD$ is 70. Find the area of triangle $EHJ$.

[asy]
pair A,B,C,D,I,F,G,H,J;
A=(0,0);
B=(9,0);
C=(9,5);
D=(0,5);
F=(3,0);
G=(6,0);
I=(4.5,5);
H=(3.5,1.67);
J=(5,3.33);
draw(A--B--C--D--cycle);
draw(A--C);
draw(F--I--G);
label("$A$",A,W);
label("$B$",B,E);
label("$C$",C,E);
label("$D$",D,W);
label("$E$",I,N);
label("$F$",F,S);
label("$G$",G,S);
label("$H$",H,NW);
label("$J$",J,NE);
[/asy]

solution:
The area of triangle $EFG$ is $(1/6)(70)=35/3$. Triangles $AFH$ and $CEH$ are similar, so $3/2 = EC/AF=EH/HF$ and $EH/EF=3/5$. Triangles $AGJ$ and $CEJ$ are similar, so $3/4=EC/AG=EJ/JG$ and $EJ/EG=3/7$. [asy]
pair A,B,C,D,EE,I,F,G,H,J;
A=(0,0);
B=(9,0);
C=(9,5);
D=(0,5);
EE = (C + D)/2;
F=(3,0);
G=(6,0);
I=(4.5,5);
H = extension(A, C, EE, F);
J = extension(A, C, EE, G);
draw(A--B--C--D--cycle);
draw(A--C);
draw(F--I--G);
label("$A$",A,W);
label("$B$",B,E);
label("$C$",C,E);
label("$D$",D,W);
label("$E$",I,N);
label("$F$",F,S);
label("$G$",G,S);
label("$H$",H,NW);
label("$J$",J,dir(70));
draw(H--G,dashed);
[/asy] Since the areas of the triangles that have a common altitude are proportional to their bases, the ratio of the area of $\triangle
EHJ$ to the area of $\triangle EHG$ is 3/7, and the ratio of the area of $\triangle EHG$ to that of $\triangle EFG$ is 3/5. Therefore, the ratio of the area of $\triangle EHJ$ to the area of $\triangle EFG$ is $(3/5)(3/7)= 9/35$. Thus, the area of $\triangle
EHJ$ is $(9/35)(35/3)=\boxed{3}$.

[asy]

pair X,Y,Z;

Z = (0,0);

Y = (sqrt(51),0);

X = (0,7);

draw(X--Y--Z--X);

draw(rightanglemark(Y,Z,X,15));

label("$X$",X,NE);

label("$Y$",Y,SE);

label("$Z$",Z,SW);

label("$10$",(X+Y)/2,NE);

label("$\sqrt{51}$",(Z+Y)/2,S);

[/asy]

Because this is a right triangle, $\tan X = \frac{YZ}{XZ}$.

Using the Pythagorean Theorem, we find $XZ = \sqrt{XY^2 - YZ^2} = \sqrt{100-51} = 7$.

So $\tan X = \boxed{\frac{\sqrt{51}}{7}}$.

We find the coordinates of point $B$ by solving $3x-2y = 1$ and $y = 1$ simultaneously. With $y=1,$ we get $3x-2=1,$ and so $x=1.$ Thus, $B=(1,1).$ The distance from $A$ to line $l_2$ is $1 - (-2) = 3,$ so we have \[\tfrac{1}{2} \cdot BC \cdot 3 = [\triangle ABC] = 3,\]and thus $BC = 2.$ Therefore, either $C = (3, 1)$ or $C = (-1, 1).$ If $C = (3, 1),$ then the slope of $l_3$ is $\tfrac{1-(-2)}{3-(-1)} = \tfrac{3}{4},$ and if $C=(-1,1)$, then $l_3$ is a vertical line, so its slope is undefined. Therefore, the answer is $\boxed{\tfrac34}.$
[asy]
size(6cm);
pair A=(-1,-2),B=(1,1),C=(3,1),C2=(-1,-1);
filldraw(A--B--C--cycle,gray);
draw((-4,0)--(5,0), EndArrow); label("$x$",(5,0),E);
draw((0,-4)--(0,3),EndArrow); label("$y$",(0,3),N);
real l1( real x) { return (3*x-1)/2; }
real l2 (real x) { return 1; }
real l3 (real x) { return 3/4*x-5/4; }
draw(graph(l1, -2, 2),Arrows); draw(graph(l2, -2, 4.5),Arrows); draw(graph(l3, -3, 4),Arrows);
dot("$A$",A,NW);
dot("$B$",B,NNW);
dot("$C$",C,NNW);
label("$l_1$",(2,2.5),N);
label("$l_2$",(-2,1),NW);
label("$l_3$",(3.5,1.5),N);
[/asy]

Let $z = x + yi,$ where $x$ and $y$ are integers.  Then
\begin{align*}
z \overline{z}^3 + \overline{z} z^3 &= z \overline{z} (z^2 + \overline{z}^2) \\
&= |z|^2 ((x + yi)^2 + (x - yi)^2) \\
&= (x^2 + y^2)(x^2 + 2xyi - y^2 + x^2 - 2xyi - y^2) \\
&= (x^2 + y^2)(2x^2 - 2y^2) = 350,
\end{align*}so $(x^2 + y^2)(x^2 - y^2) = 175.$

Since $x^2 + y^2$ is positive, $x^2 - y^2$ is also positive.  So we seek the ways to write 175 as the product of two positive integers.  Also, $x^2 + y^2 > x^2 - y^2,$ which gives us the following ways:
\[
\begin{array}{c|c|c|c} 
x^2 + y^2 & x^2 - y^2 & x^2 & y^2 \\ \hline
175 & 1 & 88 & 87 \\
35 & 5 & 20 & 15 \\
25 & 7 & 16 & 9
\end{array}
\]The only possibility is $x^2 = 16$ and $y^2 = 9.$  Then $x = \pm 4$ and $y = \pm 3,$ so the four complex numbers $z$ are $4 + 3i,$ $4 - 3i,$ $-4 + 3i,$ and $-4 - 3i.$  When we plot these in the complex plane, we get a rectangle whose dimensions are 6 and 8.

[asy]
unitsize(0.5 cm);

pair A, B, C, D;

A = (4,3);
B = (4,-3);
C = (-4,-3);
D = (-4,3);

draw(A--B--C--D--cycle);

dot("$4 + 3i$", A, NE);
dot("$4 - 3i$", B, SE);
dot("$-4 - 3i$", C, SW);
dot("$-4 + 3i$", D, NW);
[/asy]

The area of this rectangle is $6 \cdot 8 = \boxed{48}.$

We have the system of equations:

\begin{align*}
x + y &= 153 \\
\frac{x}{y} &= 0.7 \\
\end{align*}

From the second equation, multiplying both sides by $y$ gives $x=.7y$. Next, substituting the second equation into the first to eliminate $x$ gives $.7y+y=153$, or $y=90$. Plugging in this value into the first equation in the original system of equations gives $x+90=153$ or $x=63$. Thus, $y-x=90-63=\boxed{27}$.

We expand each product separately: \begin{align*}
(2x-5)(x+7) &= 2x(x) + 2x(7) -5(x) -5(7)\\
&=2x^2 +14x - 5x -35\\
&= 2x^2 +9x - 35
\end{align*}and \begin{align*}
(x+5)(2x-1) &=x(2x) + x(-1) +5(2x) + 5(-1)\\
&=2x^2 -x + 10x -5\\
&=2x^2 +9x - 5.
\end{align*}So, we have  \begin{align*}&\ \ \ \ (2x-5)(x+7) - (x+5)(2x-1) \\&= 2x^2+9x -35 - (2x^2 +9x -5) = \boxed{-30}.\end{align*}

The graph of $\frac{x^2}{a^2} + \frac{y^2}{b^2} = 1$ is an ellipse centered at the origin, with semi-axes of length $a$ and $b.$ Because the foci of the ellipse lie along the $y-$axis, the major axis of the ellipse must be the vertical axis. The distance between each focus of the ellipse and the center is $4,$ so we have \[b^2 - a^2 = 4^2 = 16.\]The graph of $\frac{x^2}{a^2} - \frac{y^2}{b^2} = 1$ is an hyperbola centered at the origin. The distance between each focus of the hyperbola and the center is $6,$ so we have \[a^2 + b^2 = 6^2 = 36.\]Therefore, we have the system of equations \[\begin{aligned} b^2-a^2 &= 16, \\ a^2+b^2 &= 36. \end{aligned}\]To solve this system, we add the two equations, giving $2b^2 = 52,$ so $b^2 = 26,$ and $b = \pm \sqrt{26}.$ Then, $26 - a^2 = 16,$ so $a^2 = 10,$ and $a = \pm \sqrt{10}.$ Thus, \[ab = (\pm \sqrt{10})(\pm \sqrt{26}) = \pm 2 \sqrt{65},\]so $|ab| = \boxed{2 \sqrt{65}}.$[asy]
void axes(real x0, real x1, real y0, real y1)
{
	draw((x0,0)--(x1,0),EndArrow);
    draw((0,y0)--(0,y1),EndArrow);
    label("$x$",(x1,0),E);
    label("$y$",(0,y1),N);
    for (int i=floor(x0)+1; i<x1; ++i)
    	draw((i,.1)--(i,-.1));
    for (int i=floor(y0)+1; i<y1; ++i)
    	draw((.1,i)--(-.1,i));
}
path[] yh(real a, real b, real h, real k, real x0, real x1, bool upper=true, bool lower=true, pen color=black)
{
	real f(real x) { return k + a / b * sqrt(b^2 + (x-h)^2); }
    real g(real x) { return k - a / b * sqrt(b^2 + (x-h)^2); }
    if (upper) { draw(graph(f, x0, x1),color,  Arrows); }
    if (lower) { draw(graph(g, x0, x1),color,  Arrows); }
    path [] arr = {graph(f, x0, x1), graph(g, x0, x1)};
    return arr;
}
void xh(real a, real b, real h, real k, real y0, real y1, bool right=true, bool left=true, pen color=black)
{
	path [] arr = yh(a, b, k, h, y0, y1, false, false);
    if (right) draw(reflect((0,0),(1,1))*arr[0],color,  Arrows);
    if (left) draw(reflect((0,0),(1,1))*arr[1],color,  Arrows);
}
void e(real a, real b, real h, real k)
{
	draw(shift((h,k))*scale(a,b)*unitcircle);
}
size(8cm);
