Also, by the Law of Cosines on triangle $YOZ,$
\[YZ = \sqrt{3^2 + 7^2 - 2 \cdot 3 \cdot 7 \cos \theta} = \sqrt{58 - 42x}.\]By the Law of Cosines on triangle $XOZ,$
\begin{align*}
XZ &= \sqrt{7^2 + 10^2 - 2 \cdot 7 \cdot 10 \cos (90^\circ - \theta)} \\
&= \sqrt{149 - 140 \sin \theta} \\
&= \sqrt{149 - 140 \sqrt{1 - x^2}}.
\end{align*}Thus, the expression we want to minimize is $YZ + XZ.$  By the Triangle Inequality, $YZ + XZ \ge XY = \sqrt{109}.$  Equality occurs when $Z$ is the point on $\overline{XY}$ such that $OZ = 7,$ so the minimum value is $\boxed{\sqrt{109}}.$

