Four diagonals of a regular octagon with side length 2 intersect as shown.  Find the area of the shaded region. [asy]
pair A, B, C, D, E, F, G, H;
real x = 22.5;
pair A = dir(x);
pair B = dir(45+x);
pair C = dir(45*2+x);
pair D = dir(45*3+x);
pair E = dir(45*4+x);
pair F = dir(45*5+x);
pair G = dir(45*6+x);
pair H = dir(45*7+x);
draw(A--B--C--D--E--F--G--H--cycle);

draw(A--D--G);
draw(C--H--E);
pair Q = intersectionpoint(A--D,C--H);
pair R = intersectionpoint(H--E,D--G);
filldraw(D--Q--H--R--cycle,heavycyan);
[/asy]

solution:
Label the points as shown below: [asy]
pair A, B, C, D, E, F, G, H;
real x = 22.5;
pair A = dir(x);
pair B = dir(45+x);
pair C = dir(45*2+x);
pair D = dir(45*3+x);
pair E = dir(45*4+x);
pair F = dir(45*5+x);
pair G = dir(45*6+x);
pair H = dir(45*7+x);
draw(A--B--C--D--E--F--G--H--cycle);
label("$A$", A, NE);
label("$B$", B, N);
label("$C$", C, N);
label("$D$", D, NW);
label("$E$", E, SW);
label("$F$", F, S);
label("$G$", G, S);
label("$H$", H, SE);
draw(A--D--G);
draw(C--H--E);
pair Q = intersectionpoint(A--D,C--H);
label("$Q$",Q,NE);
pair R = intersectionpoint(H--E,D--G);
label("$R$",R,NE);
[/asy] We can find the area of $DQHR$ by finding the length of the height and base.  The length of the height is equal to the side length of the octagon, which is 2.  To find the length of base $RH$, we notice that $RH=EH-ER$.  Because of the parallel lines, $ERGF$ is a parallelogram, and thus $ER=FG=2$.

[asy]
draw((0,0)--(2,0)--(2+sqrt(2),sqrt(2))--(2,sqrt(2))--(0,sqrt(2))--(-sqrt(2),sqrt(2))--cycle);
draw((0,0)--(0,sqrt(2)),dashed); draw((2,0)--(2,sqrt(2)),dashed);
label("$F$",(0,0) ,SW ); label("$G$", (2,0), SE); label("$H$",(2+sqrt(2),sqrt(2)) ,NE ); label("$N$",(2,sqrt(2)) ,N ); label("$M$", (0,sqrt(2)),N ); label("$E$",(-sqrt(2),sqrt(2)) ,NW );

[/asy]

To find $EH$, we drop two perpendiculars from $F$ and $G$ to $EH$, creating two isosceles right triangles $\triangle EMF$ and $\triangle HNG$, and one rectangle $MNGF$.  Since we have $EF=FG=GH=2$, we have $MN=2$ as well.  Also, we have $EM=NH=2/\sqrt{2}=\sqrt{2}$.  Thus, $EH=\sqrt{2}+2+\sqrt{2}=2+2\sqrt{2}$.

Finally, we have $RH=EH-ER = 2+2\sqrt{2}-2=2\sqrt{2}$.  The area of parallelogram $DQRH$ is thus $(2\sqrt{2})(2) = \boxed{4\sqrt{2}}$.

Here is the initial diagram:

[asy]
unitsize(1 cm);

pair A, B, C;

A = (0,2);
B = (-3,2);
C = (-3,0);

draw(A--B--C--cycle);
draw((-3.5,0)--(3.5,0));
draw((0,-3.5)--(0,3.5));

dot("$A$", A, E);
dot("$B$", B, NW);
dot("$C$", C, S);
[/asy]

We then reflect the diagram over the $x$-axis:

[asy]
unitsize(1 cm);

pair A, B, C, Ap,  Bp, Cp;

A = (0,2);
B = (-3,2);
C = (-3,0);
Ap = reflect((0,0),(1,0))*(A);
Bp = reflect((0,0),(1,0))*(B);
Cp = reflect((0,0),(1,0))*(C);

draw(A--B--C--cycle);
draw(Ap--Bp--Cp--cycle);
draw((-3.5,0)--(3.5,0));
draw((0,-3.5)--(0,3.5));

dot("$A$", A, E);
dot("$B$", B, NW);
dot("$C$", C, NW);

dot("$A'$", Ap, E);
dot("$B'$", Bp, SW);
dot("$C'$", Cp, SW);
[/asy]

We then rotate the diagram $90^\circ$ counter-clockwise around the origin:

[asy]
unitsize(1 cm);

pair A, B, C, App, Bpp, Cpp;

A = (0,2);
B = (-3,2);
C = (-3,0);
App = rotate(90)*reflect((0,0),(1,0))*(A);
Bpp = rotate(90)*reflect((0,0),(1,0))*(B);
Cpp = rotate(90)*reflect((0,0),(1,0))*(C);

draw(A--B--C--cycle);
draw(App--Bpp--Cpp--cycle);
draw((-3.5,0)--(3.5,0));
draw((0,-3.5)--(0,3.5));

dot("$A$", A, E);
dot("$B$", B, NW);
dot("$C$", C, S);

dot("$A''$", App, N);
dot("$B''$", Bpp, SE);
dot("$C''$", Cpp, W);
[/asy]

Then to transform triangle $A''B''C''$ to triangle $ABC,$ we can reflect over the line $y = x.$  The answer is $\boxed{\text{(D)}}.$

\[
