solution:
The thicker solid line in the diagram shows the shortest path that one person could travel. The circle is equally divided into six 60-degree arcs, so the short distance is 40 feet, the same as a radius. The dotted line is a diameter that separates the quadrilateral into two 30-60-90 triangles. The longer leg is $(80\sqrt {3})/2$, or $40\sqrt{3}$ feet. Each person travels $40\sqrt{3} + 40 + 40 + 40\sqrt{3} = 80 + 80\sqrt{3}$ feet. After all six people did this, $6(80 + 80\sqrt{3}) = \boxed{480 + 480\sqrt{3}\text{ feet}}$ had been traveled. [asy]
import olympiad; import geometry; size(100); defaultpen(linewidth(0.8)); dotfactor=4;
draw(unitcircle);
for(int i = 0; i <= 6; ++i){
dot(dir(60*i + 30));
}
draw(dir(30)--dir(90)--dir(150)--dir(270)--cycle);
draw(dir(90)--dir(270),dotted);
[/asy]

problem:
Let \[f(n) =
\begin{cases}
n^2-1 & \text{ if }n < 4,
\\ 3n-2 & \text{ if }n \geq 4.
\end{cases}
\]Find $f(f(f(2)))$.

solution:
By Pythagoras, $\angle ABC = 90^\circ$.  Let $P$ and $Q$ be the projections of $D$ onto $BC$ and $AB$, respectively.

[asy]
unitsize(1 cm);

pair A, B, C, D, P, Q;

A = (0,3);
B = (0,0);
C = (4,0);
D = (12/7,12/7);
P = (12/7,0);
Q = (0,12/7);

draw(A--B--C--cycle);
draw(B--D);
draw(P--D--Q);

label("$A$", A, NW);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NE);
label("$P$", P, S);
label("$Q$", Q, W);
label("$x$", (D + P)/2, E);
label("$x$", (D + Q)/2, N);
label("$x$", (B + P)/2, S);
label("$x$", (B + Q)/2, W);
label("$4 - x$", (C + P)/2, S);
label("$3 - x$", (A + Q)/2, W);
[/asy]

We have that $\angle ABC = 90^\circ$ and $\angle PBD = 45^\circ$, so quadrilateral $BPDQ$ is a square.  Let $x$ be the side length of this square.

Then $PC = BC - BP = 4 - x$, and $AQ = AB - QB = 3 - x$.  Triangles $AQD$ and $DPC$ are similar, so \[\frac{AQ}{QD} = \frac{DP}{PC},\]or \[\frac{3 - x}{x} = \frac{x}{4 - x}.\]Solving for $x$, we find $x = 12/7$.  Then $BD = x \sqrt{2} = 12/7 \cdot \sqrt{2}$, so the answer is $\boxed{\frac{12}{7}}$.

Let $c$ equal the cost of a bouquet of 39 roses (in dollars). Since we know that the price of a bouquet is directly proportional to the number of roses it contains, we can set up the following proportion \begin{align*} \frac{c}{39}&=\frac{20}{12}
\\\Rightarrow \qquad c&=\left(\frac{20}{12}\right)(39)
\\\Rightarrow \qquad c&=\boxed{65}
\end{align*}

We must find the radius of the circle in order to find the area. We are told that points $A$ and $B$ are the endpoints of a diameter, so we use the distance formula to find the length of the diameter.

\begin{align*}
\sqrt{(-1-3)^2+(-2-2)^2} &= \sqrt{16 + 16} \\
&= 4\sqrt{2}
\end{align*}Since the diameter has a length of $4\sqrt{2}$, the radius must have length $2\sqrt{2}$. Therefore, the answer is $(2\sqrt{2})^2\pi = \boxed{8\pi}$.

